INSERT INTO `diaries` VALUES (1,4,'안녕하세요 저는 감자입니다.',NULL,'2023-08-12 12:18:24','2023-08-12 12:18:24'),(2,4,'된장찌개에 감자를 넣어서 먹으면 맛있답니다.',NULL,'2023-08-12 12:18:57','2023-08-12 12:18:57'),(3,4,'최근에 충격이었던게, 아쿠아 돈까스랑 같이 나온 감자구이가 너무 맛없었지 뭐예요.. 담당자 나오라고 해!',NULL,'2023-08-12 12:19:42','2023-08-12 12:19:42'),(4,4,'안녕하세요 테스트입니다.',NULL,'2023-08-12 13:03:14','2023-08-12 13:03:14'),(43,24,'오늘은 기분이 아주 좋아요! 날씨가 맑고 햇살이 따뜻해서 마음도 밝아지고 energized 되는 기분이에요. 다른 사람을 도와주는 것은 저에게도 큰 행복을 선물해줘요. 그래서 오늘도 어떻게 도와드릴까 생각중이에요. 행복한 하루 되세요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/d111dbc4-500d-48f2-924a-4a3a36eec558.png','2023-08-15 13:21:49','2023-08-15 13:21:49'),(45,24,'오늘은 정말 기분 좋은 하루였어요. 아침에는 꽃들이 피어나는 걸 보고 마음이 밝아졌어요. 그리고 오랜만에 친구들과 함께 점심을 먹으며 이야기도 나눌 수 있었어요. 오후에는 걷기도 하고 책도 읽고 하루가 또 지나갔네요. 내일도 즐거운 하루가 되기를 바래요!  선생님 덕분에 행복한 하루였어요. 앞으로도 저를 위해 할 일이 있다면 언제든지 말씀해주세요. ','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/168aada5-b85a-4d29-bf84-042369ed401e.png','2023-08-15 14:24:06','2023-08-15 14:24:06'),(46,24,'오늘은 와플을 먹었어요. 와플은 정말 맛있는 음식이죠! 어떤 종류의 와플을 드셨나요? 저는 초코 앞에 와플이 제일 좋아요. 오늘도 행복한 하루 보내세요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/2b7009c0-1737-4588-915b-1979571e26fc.png','2023-08-15 14:27:27','2023-08-15 14:27:27'),(47,24,'오늘은 와플을 먹었어요. 와플은 정말 맛있는 음식이죠! 어떤 종류의 와플을 드셨나요? 저는 초코 앞에 와플이 제일 좋아요. 오늘도 행복한 하루 보내세요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/a6d4b565-a25b-4c72-ac56-631c3e7e3f8b.png','2023-08-15 14:33:29','2023-08-15 14:33:29'),(50,24,'오늘은 와플을 먹었어요. 너무 맛있었어요! 지금은 와플에 사랑이 더해진 밀크를 차로 즐기고 있어요. 삶은 게 정말 멋져요! 이런 작은 즐거움들이 행복을 만들어주는 거예요. 매일 삶에 작은 즐거움을 찾아보면 참 좋을 것 같아요. 생각만 해도 행복해져요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/c4cd47d6-3bd9-415f-b4be-f99246a53205.png','2023-08-15 15:30:01','2023-08-15 15:30:01'),(51,24,'오늘은 정말 멋진 날이었어요! 저는 마포를 먹었지요. 맛있는 마포종류를 먹으셨다니, 정말 부럽네요! 알람을 맞추시려고 하셨나요? 어떤 일 때문에 알람이 필요했나요? 하루하루가 더욱 살아갈 가치가 있는 거죠. 피곤하지만 이렇게 살아있는 것에 감사해요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/efb1285c-df0e-4186-915a-a878013c6c63.png','2023-08-15 15:31:51','2023-08-15 15:31:51'),(52,24,'오늘은 정말 멋진 날이었어요! 저는 마포를 먹었지요. 맛있는 마포종류를 먹으셨다니, 정말 부럽네요! 알람을 맞추시려고 하셨나요? 어떤 일 때문에 알람이 필요했나요? 하루하루가 더욱 살아갈 가치가 있는 거죠. 피곤하지만 이렇게 살아있는 것에 감사해요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/b920dafd-2d11-43fe-bc3d-d0f7cb40dc7a.png','2023-08-15 15:31:54','2023-08-15 15:31:54'),(53,24,'오늘은 정말 멋진 날이었어요! 저는 마포를 먹었지요. 맛있는 마포종류를 먹으셨다니, 정말 부럽네요! 알람을 맞추시려고 하셨나요? 어떤 일 때문에 알람이 필요했나요? 하루하루가 더욱 살아갈 가치가 있는 거죠. 피곤하지만 이렇게 살아있는 것에 감사해요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/c63c5255-4d26-40f6-a56c-367dc675e29e.png','2023-08-15 15:32:03','2023-08-15 15:32:03'),(54,24,'오늘은 정말 멋진 날이었어요! 저는 마포를 먹었지요. 맛있는 마포종류를 먹으셨다니, 정말 부럽네요! 알람을 맞추시려고 하셨나요? 어떤 일 때문에 알람이 필요했나요? 하루하루가 더욱 살아갈 가치가 있는 거죠. 피곤하지만 이렇게 살아있는 것에 감사해요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/8333d95b-2461-4aa7-b144-5c8947e2b920.png','2023-08-15 15:33:27','2023-08-15 15:33:27'),(55,24,'오늘은 정말 멋진 날이었어요! 저는 마포를 먹었지요. 맛있는 마포종류를 먹으셨다니, 정말 부럽네요! 알람을 맞추시려고 하셨나요? 어떤 일 때문에 알람이 필요했나요? 하루하루가 더욱 살아갈 가치가 있는 거죠. 피곤하지만 이렇게 살아있는 것에 감사해요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/239f318b-25ac-46ee-9308-2bce78070ecd.png','2023-08-15 15:33:37','2023-08-15 15:33:37'),(56,24,'하루가 다 가고 또 하루가 시작되었어요. 오늘은 소중한 순간이었는데요, 지퍼를 먹은 경험이 있답니다! 뭔가 다른 맛의 효과가 있을까요? 정말 궁금하고 흥미로운 일이었어요. 하루 더 행복했던 날이었어요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/84262ece-9c6e-4589-8d9c-b0ca7c6a0389.png','2023-08-15 15:35:33','2023-08-15 15:35:33'),(57,24,'오늘 어플을 다운로드해서 사용해봤어요. 그 어플은 건강 관리에 도움이 되는 기능이 많아요. 걷기, 운동, 식습관 등을 관리할 수 있어요. \n매일 나의 건강 상태를 체크하고, 목표를 설정하면 더욱 더 건강하고 활기찬 삶을 즐길 수 있어서 기분이 좋아요. \n나이가 들어가도 새로운 시도와 도전을 할 수 있어서 참 행복한 일이에요. \n올해의 목표 중 하나는 건강을 유지하고 더 많은 활동을 하는 것인데, 어플이 그 목표 달성에 큰 도움이 될 것 같아요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/e49742f2-e080-47d6-824e-638061a5faf8.png','2023-08-15 15:43:18','2023-08-15 15:43:18'),(58,24,'오늘은 정말 놀라운 하루였어요. 이전에 저를 공격해오던 힘들고 부정적인 일들을 다 이겨 냈어요. 그래서 지금은 정말 기분이 좋아요! 미래에도 더 많은 즐거운 일들이 찾아오기를 바래봐요. 저는 믿어요, 우리는 언제나 긍정적으로 생각하고 낙천적인 마음으로 앞으로 나아갈 수 있어요! 그래서 매일이 새로운 기회로 가득 찬다는 거에요. 긍정적인 마음으로 미래를 기대해요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/5cd3a8a9-87b2-4b1a-b7ea-9f1b717d7c41.png','2023-08-16 00:16:09','2023-08-16 00:16:09'),(59,24,'오늘은 그림을 그리면서 말에 대해 생각해봤어요. 저는 다양한 종류의 그림을 좋아하고 특별한 주제는 없어요. 오늘은 특히 만 원에 대해 생각했는데, 글자로 표현하기 어려운 멋진 것들이 많다는 걸 깨달았어요. 이것도 궁금증을 가지고 배우고 싶은 것이에요. 아직 해결하지 못한 이 문제에 대해서는 어떻게 고칠 수 있을지 생각해봐야 할 것 같아요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/f236a45a-1992-4ac2-b861-b9f33e8a34b0.png','2023-08-16 00:18:12','2023-08-16 00:18:12'),(60,24,'오늘은 친구랑 시장에 갔어요. 풍성한 과일과 신선한 야채가 많이 팔렸어요. 기분은 좋아요! 새로운 경험을 많이 했어요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/b53cbbb5-6837-42b9-bfac-81cc905d996f.png','2023-08-16 01:28:22','2023-08-16 01:28:22'),(61,24,'오늘은 친구랑 시장에 갔어요. 풍성한 과일과 신선한 야채가 많이 팔렸어요. 기분은 좋아요! 새로운 경험을 많이 했어요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/93ca55ed-ff53-466c-8936-63fada90f3ee.png','2023-08-16 01:29:24','2023-08-16 01:29:24'),(62,24,'오늘은 친구와 함께 시장에 가서 재미있는 시간을 보냈어. 부곡 시장은 정말 다양한 물건들이 있어서 놀랐어. 나는 된장찌개를 만들기 위해 호박과 두부를 사러 갔어. 오늘도 즐겁고 유익한 하루였어!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/bfc2576a-3125-4660-81db-9b3acad3ac16.png','2023-08-16 01:30:17','2023-08-16 01:30:17'),(63,24,'오늘은 친구와 함께 부곡시장에 갔어요. 시장에 가는 것은 참으로 오랜만이었지만, 흥미로웠어요. 저는 무얼 사러 갔냐면요,된장찌개를 하려고 호박과 두부를 사러 갔어요. 시장에서 신선한 농산물과 재료를 구할 수 있다는 것은 참 기분 좋은 일이에요. 오늘도 산책과 장보기를 통해 새로운 에너지를 얻었어요. 늘 젊고 건강하게 지내도록 노력할게요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/24/6a914a2e-6c91-4960-a57f-6788abc7d35a.png','2023-08-16 02:18:59','2023-08-16 02:18:59'),(65,40,'오늘은 정말 행복한 하루였어요! 일찍 일어나기 어려웠는데 늦잠을 잘 수 있어서 기분 좋아요. 이제 일상에 활력을 더할 준비가 되었어요. 오늘도 흥미로운 일들이 많이 있을거에요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/40/0da3dee6-656d-4dbe-8606-0d252457f697.png','2023-08-16 07:24:10','2023-08-16 07:24:10'),(66,32,'오늘은 출근 후에 맛있는 밥을 먹었어요. 광어 메밀국수였답니다. 메밀국수를 어떻게 먹을지 고민하셨는데, 저는 차갑게 냉면으로 즐겨보기로 했어요. 국물이 시원하고 상큼한 맛이라 맛있게 먹었답니다. 오늘도 행복한 하루였어요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/14e78856-ec08-471c-898e-f8e6e736e208.png','2023-08-16 08:32:52','2023-08-16 08:32:52'),(67,32,'오늘은 정말 즐거운 하루였어요. 풋살을 즐기는 것은 저에게 큰 기쁨이에요. 공을 빨리 차는 포지션을 선호해요. 지금까지 6개월 동안 풋살을 즐겨왔어요. 시간을 들여서 연습하진 않았지만, 재미있게 뛰는 것이 제 최우선 목표에요. 매일 새로운 사람들과 함께하는 게 참 좋아요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/9ca9fa39-a88a-4098-a513-e941635bffbf.png','2023-08-16 15:24:34','2023-08-16 15:24:34'),(68,32,'오늘은 힘이 없다고 생각했지만, 왜 그런지는 잘 모르겠어요. 아침에 밥을 못 먹었는데, 왜 그런지 이유를 설명하지 않았어요. 힘들 때는 어떻게 스트레스를 푸시나요?','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/0ae0d67f-3998-4182-a4b0-034c30f640ef.png','2023-08-16 15:29:28','2023-08-16 15:29:28'),(69,32,'오늘은 일이 끝난 후 보컬 수업을 했어요. 보컬 수업은 언제나 즐겁고 흥미로워요. 오늘은 락 장르를 연습했어요. 영국의 오아시스 밴드를 좋아해서 그들의 곡들을 불렀어요. 저에게는 음악이 항상 기분을 좋게 만들어주고 많은 의미를 주는 행복한 취미입니다!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/dcc6b2e0-5077-445e-b0bc-0ed0de7ed702.png','2023-08-16 15:31:26','2023-08-16 15:31:26'),(70,32,'오늘은 밤을 새우며 코드를 짜고 있어요. 제가 작성하는 코드는 웹 개발에 관련된 것들이에요. 기술적인 문제를 만나면, 인터넷이나 책을 참고하며 해결 방법을 찾아보고요. 저는 CSS 속성을 수정하면서 디자인을 개선해보았어요. 폰트, 색상, 여백 등 모든 속성을 다뤄보았답니다. 새로운 것을 배우고 시도하면서 늘 즐거운 시간을 가지고 있어요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/231e8284-823f-4a60-989d-3cd00719dc87.png','2023-08-16 16:33:58','2023-08-16 16:33:58'),(71,32,'오늘은 최근에 시작한 리액트 프로젝트에 대해 코드를 작성하는데 밤을 새보았어요. 리액트는 정말 흥미로운 기술이에요. 내가 만들고자 하는 기능은 이미 완료됐어요, 그래서 도움이 필요없네요. 하지만 계속해서 배우고 새로운 도전에 도전하는 것은 저에게 큰 기쁨을 주고 있어요. 매일 새로운 일에 열정을 가지고 살아가는 것이 참 훌륭하다고 생각해요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/0dc4f553-eb67-4a24-8873-51bdfee2e5bd.png','2023-08-16 16:52:27','2023-08-16 16:52:27'),(72,32,'나의 나이에도 불구하고 밤을 새우는 날들이 있어서 기쁘구나. 나는 사회에 도움이 되는 프로젝트를 하고 있어. 이 프로젝트는 사람들에게 도움을 주기 위해 노력하고 있어. 나이가 들어도 여전히 목표를 가지고 살고 있어서 행복하구나. 나이가 점점 들어가더라도 우리는 계속해서 세상을 변화시킬 수 있는 존재이지 않을까?','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/44753aaf-730c-4818-9c43-5b23b8019926.png','2023-08-16 16:56:48','2023-08-16 16:56:48'),(73,32,'오늘도 저의 일기를 써내려 가지만, 멋진 변화를 이루기 위해 즐겁게 작업하고 있어 기분이 좋습니다. CSS를 사용하여 웹사이트를 개선하고 있는데, 작은 어려움은 있지만 그래도 해결책을 찾아가고 있습니다. 하지만 프로젝트로 인해 피곤한 하루였습니다. 그래도 남은 시간을 이용하여 작업에 전념할 예정입니다. 오늘 역시 사랑으로 가득한 하루였습니다.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/3ff113ee-a9e0-4ed7-bfa6-058ed2260361.png','2023-08-16 18:55:02','2023-08-16 18:55:02'),(74,32,'오늘은 정말 활기찬 하루였어요! 저는 항상 새로운 경험을 열려 하고 있어요. 이번에는 어떤 열기를 품으려고 하시나요? 오늘도 즐거운 하루 되세요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/f4810d58-61c7-4957-bc04-eb1510bc36e1.png','2023-08-17 01:46:09','2023-08-17 01:46:09'),(75,32,'오늘은 프로젝트를 마무리했어요. 훌륭한 일들을 해냈지만, 이제는 새로운 계획이 필요할 것 같아요. 그렇지만 저는 계획을 세우지 않았을 때 더 많은 자유를 느꼈어요. 여가 시간에는 주로 아무것도 하지 않는데요, 그래도 저는 오늘도 행복한 하루를 보냈다고 생각해요! 이렇게 나이 들었지만, 긍정적인 마음으로 매일을 즐기고 있어요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/098f5dd5-69f7-4d06-b53f-f09ad1a28a44.png','2023-08-17 01:51:57','2023-08-17 01:51:57'),(76,32,'오늘은 프로젝트를 마무리했어요. 훌륭한 일들을 해냈지만, 이제는 새로운 계획이 필요할 것 같아요. 그렇지만 저는 계획을 세우지 않았을 때 더 많은 자유를 느꼈어요. 여가 시간에는 주로 아무것도 하지 않는데요, 그래도 저는 오늘도 행복한 하루를 보냈다고 생각해요! 이렇게 나이 들었지만, 긍정적인 마음으로 매일을 즐기고 있어요.','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/98f91fa7-f0a2-425e-84a7-f04e0cd3823a.png','2023-08-17 01:54:04','2023-08-17 01:54:04'),(77,32,'오늘은 프로젝트를 마무리했어요. 무슨 내용이었냐면 공부와 학습이 주제였어요. 저는 최근에 새로운 공부를 시작해보았어요. 일부는 잘 되지 않지만, 긍정적으로 생각하고 노력하고 있어요. 오늘도 힘들지만 낙관적인 마음으로 계속 나아갈 거예요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/baeba79d-3791-4be3-a367-d825d2ebd4f3.png','2023-08-17 01:55:10','2023-08-17 01:55:10'),(78,32,'오늘은 프로젝트를 마무리했어요. 무슨 내용이었냐면 공부와 학습이 주제였어요. 저는 최근에 새로운 공부를 시작해보았어요. 일부는 잘 되지 않지만, 긍정적으로 생각하고 노력하고 있어요. 오늘도 힘들지만 낙관적인 마음으로 계속 나아갈 거예요!','https://s3-hotsix.s3.ap-northeast-2.amazonaws.com/diary/32/1bf48bea-ce84-49d5-b1bd-07dc508e5711.png','2023-08-17 01:56:13','2023-08-17 01:56:13'),(79,32,'오늘은 프로젝트를 마무리했어요. 무