INSERT INTO `themes` VALUES (16,'일상',2,NULL,'버스를 타요','친구와 함께 버스를 타고 시장에 갔다. 정류장에서 노선을 확인하고 버스를 기다렸다. 시장이 멀어서 환승해야했다. 교통카드를 찍고 버스를 탔다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(17,'일상',3,NULL,'시장에 가요','시장에 도착하니 다양한 가게들이 있었다. 반찬거리를 계산하고 장바구니에 담았다. 장을 보고 나니 배가 출출했다. 시장에 있는 포장마차에서 어묵과 순대를 먹었다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(18,'일상',4,NULL,'요리를 해요','시장에서 사온 재료로 맛있는 저녁을 만들었다. 먼저 앞치마를 입고, 감자를 삶았다. 냄비에 된장찌개를 끓였다. 식사를 끝내고 수업을 듣기 전, 설거지를 했다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(19,'일상',5,NULL,'수업을 들어요','수업 시간이 되어, 태블릿을 켰다. 선생님과 함께 공부하는 건 즐겁다. 수업이 끝나면 선생님이 숙제를 내주신다. 시장에 다녀오느라 피곤해서 숙제는 내일 아침에 하려고 한다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(20,'명절',1,NULL,'음력 1월 1일은 설날이에요','따뜻한 떡국을 먹으며 설날을 맞이했다. 차례를 지내고 가족들과 맛있는 음식도 먹었다. 토끼 같은 손주들이 세뱃돈을 받고 기뻐하는 모습에 기분이 좋다. 오후에는 윷놀이를 하며 재밌는 시간을 보냈다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(21,'명절',2,NULL,'음력 1월 15일은 정월 대보름이에요.','오늘은 음력 1월 15일 정월대보름이다. 보름달이 아주 크고 예뻤다. 곳곳에서 쥐불놀이를 하는 모습이 보기 좋았다. 집으로 돌아와 만들어 둔 약밥을 먹으며 하루를 마무리했다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(22,'명절',3,NULL,'음력 4월 8일은 부처님 오신 날이에요.','석가탄신일이라 친구들과 절에 갔다. 거리가 화려한 연등으로 꾸며져 있었다. 절에 도착하고 법회를 들으러 갔다. 법회를 다 들은 후, 비빔밥을 먹었다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(23,'명절',4,NULL,'5월 5일은 어린이날이에요','어린이날이라 손주의 얼굴에 웃음꽃이 피었다. 손주가 좋아하는 장난감을 사러 대형 마트로 갔다. 좋아하는 장난감을 얻어 행복해하는 손주가 귀엽다. 집으로 돌아와 손주의 재롱잔치도 볼 수 있었다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(24,'명절',5,NULL,'음력 8월 15일은 추석이에요','오늘은 가을의 선선한 바람이 불어오는 추석이다. 이번 농사가 풍년이라 풍성한 한가위를 보낼 수 있다. 추석이라 송편을 먹고 성묘도 다녀왔다. 가족들과 명절을 보내서 즐거운 하루였다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(25,'병원',1,NULL,'친구 병문안을 가요','병원에서 치료 중인 친구 병문안을 갔다. 환자복을 입은 모습이 어색하고 마음아팠다. 그래도 함께 웃으며 이야기하니 친구의 표정이 밝아졌다. 친구는 내일 퇴원한다는 좋은 소식을 전해줬다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(26,'병원',2,NULL,'배우자가 수술을 받아요','남편이 수술을 받게 되었다. 보호자로서 수술 동의서를 작성했다. 다행히, 의사 선생님이 금방 회복될 것이라고 했다. 빨리 낫도록 잘 간호해야겠다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(27,'병원',3,NULL,'감기에 걸려서 병원을 가요','재채기가 자꾸 나와서 병원에서 진료를 받았다. 면역력이 약해져서 감기에 걸린 것 같다고 말씀하셨다.  처방전을 받고 약국에서 약을 지었다. 꾸준히 건강 관리를 해야겠다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(28,'병원',4,NULL,'건강검진을 받아요','지난 주말에 예약한 건강검진을 받는 날이다. 오후에 병원에 가서 엑스레이를 찍었다. 당뇨 합병증이 걱정되어 의사와 상담도 했다. 다행히 결과가 좋아서 안심이 되었다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(29,'병원',5,NULL,'한의원에 가요','허리 통증이 심해져서 한의원에 다녀왔다. 원장님이 내 체질을 진단했다. 뜸 치료를 받았는데 허리가 훨씬 편안해졌다. 통증이 많이 완화된 것 같다.','2023-08-10 07:51:16','2023-08-10 07:51:16'),(30,'은행',1,'https://s3.ap-northeast-2.amazonaws.com/s3-hotsix/%ED%85%8C%EB%A7%88/%EC%9D%80%ED%96%891.png','통장을 만들어요','통장을 개설하러 은행에 다녀왔다. 통장을 개설하는데 주민등록증과 서명이 필요했다. 창구로 향하자, 친절한 은행원이 맞이해주었다. 통장에 대해 상담받고 통장을 개설했다.','2023-08-10 07:51:16','2023-08-14 05:37:32'),(31,'은행',2,'https://s3.ap-northeast-2.amazonaws.com/s3-hotsix/%ED%85%8C%EB%A7%88/%EC%9D%80%ED%96%892.png','돈을 입금해요','입금하러 은행에 갔다. 청원경찰이 번호표를 뽑는 걸 도와줬다. 내 차례가 될 때까지 대기석에 앉아서 기다렸다. 전표를 작성하고 입금하니 이체 수수료가 발생했다.','2023-08-10 07:51:16','2023-08-10 11:29:40'),(32,'은행',3,'https://s3.ap-northeast-2.amazonaws.com/s3-hotsix/%ED%85%8C%EB%A7%88/%EC%9D%80%ED%96%893.png','돈을 출금해요','출금하러 은행에 갔는데, 주민등록증을 깜빡했다. 다행히 계좌번호만으로 출금이 가능했다. 은행원의 도움으로 출금한 현금을 봉투에 담았다. 현금을 가지고 시장에 갔다.','2023-08-10 07:51:16','2023-08-10 11:29:40'),(33,'은행',4,'https://s3.ap-northeast-2.amazonaws.com/s3-hotsix/%ED%85%8C%EB%A7%88/%EC%9D%80%ED%96%894.png','통장을 재발급받아요','통장 만료기한이 다 되었다. 통장을 재발급 받아야 한다. 은행원에게 통장과 인감을 주니 통장을 재발급해주었다. 새 통장으로 현금지급기를 이용해 잔액도 확인했다.','2023-08-10 07:51:16','2023-08-10 11:29:40'),(34,'은행',5,'https://s3.ap-northeast-2.amazonaws.com/s3-hotsix/%ED%85%8C%EB%A7%88/%EC%9D%80%ED%96%895.png','현금지급기를 사용해요','주말에 입금을 하기 위해 현금지급기를 사용했다. 버튼이 너무 많아서 혼란스러웠다. 한 학생이 도와줘서 입금할 수 있었다. 입금 영수증은 기계로 파쇄했다.','2023-08-10 07:51:16','2023-08-10 11:29:41'),(35,'일상',1,NULL,'친구를 만나요','오늘은 오랜만에 친구를 만났다.서로 안부를 묻고 반갑다고 인사했다. 함께 과일을 먹으며 즐거운 시간을 보냈다. 그 후, 친구와 함께 버스를 타고 시장에 갔다.','2023-08-10 07:54:50','2023-08-10 07:54:50');
